import React from 'react';
import './App.css';
import { Card } from '@material-ui/core';

class Page extends React.Component {
    constructor(props) {
        super(props)
    }

    render() {
        return (
            <Card>
                <p>Hello World</p>
            </Card>
        );
    }
}

export default Page;
